Since Covid swept over the world and we started lockdown where we live, this cutie has made incredible changes and has grown so much - both my boys really have. 

I had so many ideas of things we’d do as a family of five this summer and then have so many fall activities I’d love to do. As I think of things I’d love to do I’m reminded that everything requires reservations so forget last minute decisions which is usually how things go with little ones. I’m also reminded that kids over two are expected to wear masks in public and I can’t even get my three year old to try one on. 

I get anxious over not knowing when we will be able do normal things as a family without worrying about these things, if ever. I get anxious about my kids first views of the world including smiles covered by masks and teachers who can’t hug them. My babies are growing up, our current situation has so many unknowns and this mama is feeling it all right now. 

Some days are easier than others, today is just one of those where everything seems to be sinking in.

